import { Sidebar } from '../components/Sidebar'
import { Card } from '../components/Card'

export const Home = () => {
    const cards = [
        {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abb", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        },
    ]

    return (
        <div className="bg-[#E1E1E1] flex min-h-screen max-w-screen w-full h-full">
            <Sidebar />

            <div className=" w-4/5 flex flex-col space-y-4 ml-8 mr-8 mt-4"  >
                        <div class="flex border border-gray-300 rounded-md p-2">
            <button class="flex items-center justify-center h-10 w-10 bg-gray-200 rounded-l-md">
                <svg xmlns="http://www.w3.org/2000/svg" class="h-6 w-6 text-gray-500" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M15.5 15.5l5.5 5.5"/>
                <circle cx="9" cy="9" r="7" />
                </svg>
            </button>
            <input class="flex-1 ml-2 focus:outline-none" type="text" placeholder="Pesquisar..."/>
            </div>


            <p className='text-[#4A92FF] mb-2 pt-6 font-bold text-lg'>Trending Projects</p>
                {cards.map(item => {
                    return (
                        <Card title={item.title} desc={item.desc} 
                        />
                        
                    )
                })}
            </div>
        </div>
    )
}
